$('#select-all').click(function(event) {
  if (this.checked) {
    // Iterate each checkbox
    $('.checkboxes:checkbox').each(function() {
      this.checked = true;
    });
  } else {
    $('.checkboxes:checkbox').each(function() {
      this.checked = false;
    });
  }
});

